import React from 'react';
import Header from "../Header";
import Footer from "../Footer";
import Films from "../Films";



const Film = () => {
    return (
        <div>
            <Header/>
            <Films title={"Słowacja/Węgry 05.2022"} text={"Wyjazd na Węgry, po drodze spotkałem Adriana z kanału Motopodhale. Zwiedziłem między innymi takie miejsca jak Eger, Słowacki Raj jak i nasze Morskie Oko."} image={"https://i.ytimg.com/an_webp/JUZTT_6GJrM/mqdefault_6s.webp?du=3000&sqp=CKns3JwG&rs=AOn4CLDEqhYmhvlWMZSOZ2LWE2kvPgbQUg"}/>
            <Films title={"Wyjazd do Białej Podlaskiej 06.2020"} text={"Wypad z Łukaszem na jego Derbi Terra 125. Przejazd przez jezioro Białe, Białą Podlaskę i camping nad Wiłą pod Puławami."} image={"https://i.ytimg.com/an_webp/JUZTT_6GJrM/mqdefault_6s.webp?du=3000&sqp=CKns3JwG&rs=AOn4CLDEqhYmhvlWMZSOZ2LWE2kvPgbQUg"}/>
            <Films title={"Wyjazd do Zakopanego 08.2"} text={"Wyjazd na węgry"} image={"https://i.ytimg.com/an_webp/JUZTT_6GJrM/mqdefault_6s.webp?du=3000&sqp=CKns3JwG&rs=AOn4CLDEqhYmhvlWMZSOZ2LWE2kvPgbQUg"}/>
            <Footer/>
        </div>
    );
};

export default Film;
